import React, { useState, useEffect } from 'react';

const TrainList = ({ depPlaceId, arrPlaceId, startDate, selectedTrains, setSelectedTrains }) => {
  const [trains, setTrains] = useState([]);

  useEffect(() => {
    // 예시 API 호출
    fetch(`API_URL?depPlaceId=${depPlaceId}&arrPlaceId=${arrPlaceId}&startDate=${startDate}`)
      .then(response => response.json())
      .then(data => setTrains(data.trains))
      .catch(error => console.error('Error fetching train data:', error));
  }, [depPlaceId, arrPlaceId, startDate]);

  const handleSelectTrain = (train) => {
    setSelectedTrains([...selectedTrains, train]);
  };

  return (
    <div>
      <h2>Available Trains</h2>
      <ul>
        {trains.map(train => (
          <li key={train.id}>
            {train.name}
            <button onClick={() => handleSelectTrain(train)}>Select</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default TrainList;
